import React from 'react';
import { Helmet } from 'react-helmet';

import Navbar from '../components/Nav';
import HackathonOverview from '../components/HackathonOverview';
import SepLine from '../components/SepLine';
import EventSummary from '../components/EventSummary';

import Square from '../imgs/hackathon/square_one.jpg';
import Vert from '../imgs/hackathon/vert.jpg';
import Big from '../imgs/hackathon/big.jpg';
import Banner from '../imgs/hackathon/banner.jpg';

const HackathonPage = () => {

    const what = <span>
        <span class="highlight-white">
            MIT's first <u>B</u>rain <u>C</u>omputer <u>I</u>nterfaces
            (BCI) hackathon.
        </span>
        <br /><br />
        Up to 100 MIT members will compete to control a robot using
        only their brain.
        <br /><br />
        Winning teams will receive prizes and recognition.
    </span>

    const why = <span>
        BCIs are an incredibly powerful technology, but more
        research
        is necessary
        to realize its promise.
        <br /><br />
        <span class="highlight">
            We want you to be part of this journey.
        </span>
    </span>

    const when = <span class="highlight-green">February 24<sup>th</sup> -
        25<sup>th</sup>
        2024</span>

    const where = <span>
        In person. <br />
        <span class="highlight-salmon">McGovern Institute</span> @
        MIT
    </span>

    const how = <span>
        The hackathon is open to all MIT members and is free to
        attend.
        <br /><br />
        Signups are now open, <span
            class="highlight-lightblue">secure your spot!</span>
        <br />

    </span>

    const event_summary =             <p>
        <span class="highlight-green">60</span> participants, from 7 MIT departments. 
        <br /><br />
        <span class="highlight">48</span> hours of hacking.
        <br /><br />
        <span class="highlight-salmon">14</span> X.on EEG headsets
        <br /><br />
        <span class="highlight-lightblue">12</span> teams, each with a unique approach to the challenge.
        <br /><br />
        <span class="highlight-green">3</span> Duckiebots.              
        <br /><br />
        <span class="highlight-lightblue">3</span> winning teams. 
    </p>


    return (
        <div>
            <Helmet>
                <title>BCI Initiative - MIT Hackathon</title>
            </Helmet>

            <Navbar />

            <HackathonOverview
                what={what}
                why={why}
                when={when}
                where={where}
                how={how}
            />
            <SepLine />

            <EventSummary 
                description={event_summary}
                img_square={Square}
                img_4x5={Vert}
                img_4x3={Big}
                img_3x1={Banner}
            />
            <SepLine />
        </div>
    );
};

export default HackathonPage;
